  state = {
    pageTitle: 'React Course',

    person: [
      {
        name: 'Aram',
        proff: 'Frontend Developer',
        adress: 'Yerevan',
        description: '2 years experiance',
        key: 'ar',
        img: Aram,
      },
      {
        name: 'Alice',
        proff: 'Backend Developer',
        adress: 'Moscow',
        description: '3 years experiance',
        key: 'al',
        img: Alice,
      },
      {
        name: 'John',
        proff: 'FullStack Developer',
        adress: 'New York',
        description: '5 years experiance',
        key: 'jo',
        img: John,
      },
    ],
    newPage: 'New PageTitlle Click',
  };
  render() {
    return <div className='App'></div>;
  }
}
